{"0": ["Обожаю такие миленькие вещицы. Все очень симпатично. Ниточка плотная. ", "2021-05-06T12:33:11Z", "серебристый, красный", "19.0", 1, 0, 5, "Браслет \"Красная нить\" Бесконечная любовь", "Lucente"], "4": ["Товар не соответствует описанию, в описании круглое декоративное изделие, купила три ни на одном нету.... ", "2021-03-11T10:31:48Z", "серебристый, красный", "19.0", 1, 3, 2, "Браслет \"Красная нить\" Бесконечная любовь", "Lucente"], "6": ["Заказывала с месяц или два назад нить прочная не растянулась не развязалась серебро не потемнело .рекомендую", "2020-10-03T11:38:16Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить\" Бесконечная любовь", "Lucente"], "7": ["Мне понравился браслетик. За 350 рублей ещё и в коробочке, ещё и с салфеточкой. Довольно милый. Узелки хорошо затягиваются. И серебрянные детали довольно качественные. Не тонкая проволока. Рекомендую как на символические подарки, так и для ношения в каббалистическом значении. ", "2020-09-15T21:40:00Z", "серебристый, красный", "17.0", 2, 0, 5, "Браслет \"Красная нить\" Бесконечная любовь", "Lucente"], "8": ["На вид вроде как и не серебро даже. Никакой пробы нет. И сделано грубовато. При носке не потемнело, но нитка размоталась", "2020-09-14T21:33:20Z", "серебристый, красный", "17.0", 1, 0, 4, "Браслет \"Красная нить\" Бесконечная любовь", "Lucente"], "9": ["Браслет пришёл без коробочки, мешочка и без салфетки. Серебряная вставка вся мутная. В общем для подарка не серьезно", "2020-08-17T09:21:58Z", "серебристый, красный", "17.0", 1, 0, 3, "Браслет \"Красная нить\" Бесконечная любовь", "Lucente"], "10": ["Парню идеально подошёл 19 размер, мне 21 в 2 оборота", "2020-07-12T13:55:56.394856205Z", "серебристый, красный", "19.0", 5, 0, 5, "Браслет \"Красная нить\" Бесконечная любовь", "Lucente"], "11": ["Быстро порвался", "2020-01-22T15:12:55.610531606Z", "серебристый, красный", "17.0", 1, 1, 2, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "12": ["Классный!!! Урвала за бесценок ", "2020-01-11T19:38:59.364967033Z", "серебристый, красный", "17.0", 1, 2, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "13": ["Браслет очень милый,качество-хорошее.Спасибо,WB!", "2020-01-02T03:12:34.675318132Z", "серебристый, красный", "17.0", 1, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "14": ["Милота ) браслет пришел в коробочке , всё целое .", "2019-12-24T11:40:26.208261903Z", "серебристый, красный", "17.0", 3, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "15": ["Хорошенький браслет) ", "2019-12-22T20:09:43.6354648Z", "серебристый, красный", "17.0", 1, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "16": ["Миленький тоненький браслетик, спасибо!", "2019-12-21T12:08:22.365421709Z", "серебристый, красный", "17.0", 2, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "17": ["красиво..изящно..модно) брала в подарок племяннице..надеюсь, понравится.", "2019-12-18T15:47:56.201839023Z", "серебристый, красный", "17.0", 1, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "18": ["Очень миленькая вещица советую. Брала в подарок несколько браслетов в том числе и этот.", "2019-12-18T10:43:46.22858676Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "19": ["Просто красота. Качественная продукция все видно на фото. Идеально для подарка. Рекомендую этого производителя)", "2019-12-16T10:09:48.715664261Z", "серебристый, красный", "17.0", 2, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "20": ["Тонкие, порвались через 2 дня(", "2019-12-02T17:06:35.877492493Z", "серебристый, красный", "17.0", 2, 1, 3, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "21": ["Симпатичная нить, только развязались узелки, просто сменила нить", "2019-11-27T11:02:50.721008028Z", "серебристый, красный", "17.0", 4, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "22": ["Чудесный талисманчик, нить яркая, ничего лишнего, смотрится утонченно и загадочно", "2019-11-25T18:52:57.518059864Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "23": ["Пишут маленький размер,а мне велик.нитка тонкая .за 200 руб нормально.запястье 15 см.", "2019-11-22T15:24:02.214847877Z", "серебристый, красный", "17.0", 3, 2, 4, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "25": ["Всё просто супер, брала на подарок. А красную нить заменила на черную, смотрится ещё круче...", "2019-11-24T20:38:00.754269715Z", "серебристый, красный", "17.0", 2, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "26": ["Красивая вещь. Мне понравилась.", "2019-11-24T10:16:34.609080785Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "27": ["Прекрасный браслетик! Спасибо!", "2019-11-09T12:40:31.320323754Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "29": ["Браслет миленький, посмотрим на сколько хватит", "2019-11-16T11:38:47.820403345Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "30": ["Нить тонкая, бесконечность маленькая.  Взяла за 176 р. Дороже не стоит.", "2019-11-13T05:28:49.035891045Z", "серебристый, красный", "17.0", 6, 0, 4, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "31": ["Ниточка классная, ношу почти год не снимая.\r\nЕздила с ней на море, от воды на серебре появились тёмные пятна. Отчистила зубной пастой без проблем, блестело, как новое. Поэтому сомнений в металле нет. Это серебро.\r\nУзелок развязывался, да, но не понимаю тех, кто выделяет это в проблему. Загуглить и завязать по картинке такой же узелок - 2 минуты.\r\nЗаказала еще семилетней дочке. Носит ниточку максимально затянутой, немного свободно, но не слетает. Тоже не снимает, и спит, и моется в ней. \r\nВ общем, нам очень нравится.\r\nЕсли потеряются, будем заказывать ещё. ", "2019-11-10T05:26:27.343912429Z", "серебристый, красный", "17.0", 5, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "32": ["хорошенький браслетик.", "2019-10-28T06:15:18.129860926Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "33": ["Отлично!!)))", "2019-10-23T20:53:09.74354431Z", "серебристый, красный", "17.0", 10, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "34": ["Очень хороший!", "2019-10-21T12:16:55.988653129Z", "серебристый, красный", "17.0", 4, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "35": ["Мне очень понравился браслет! Такой нежный! Прочитав, что у многих развязываются узелки, сразу же капнула на них термоклей. Надеюсь, что это поможет поносить его подольше)", "2019-10-08T12:43:21.927381267Z", "серебристый, красный", "18.0", 4, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "36": ["Все как в описании", "2019-09-15T11:13:14.127385308Z", "серебристый, красный", "17.0", 3, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "38": ["Купила для ребёнка, очень понравился браслетик. До этого носили год, перетёрся. Надеюсь, что этот тоже не мало прослужит. Спасибо!", "2019-09-25T16:22:53.010567568Z", "серебристый, красный", "17.0", 2, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "39": ["Брала два браслетика,на одном узелок развязался на третий день,на втором через неделю.Спасибо Ксении, воспользовалась рисунком,и все отлично получилось(использовала три верхние схемы,только не делала столько перехлестов как на рис.2,а всего три раза,и от заводского узелка не отличишь)!", "2019-09-09T00:12:59.141505031Z", "серебристый, красный", "17.0", 5, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "40": ["Незаметно порвался и потерялся ((((жаль((((", "2019-08-31T05:11:56.349436064Z", "серебристый, красный", "19.0", 2, 4, 3, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "41": ["Смотрится нормально. Как ожидала. Но, через час и даже меньше развязался узелок и всё рассыпалось. Производитель, что делать?", "2019-08-28T17:25:05.687605478Z", "серебристый, красный", "17.0", 3, 0, 1, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "42": ["На самом знаке бесконечности нет никакой пробы, подтверждаюзей, что это серебро. Зато клеймо производства На изнаночной стороне ( прилегает к руке) поставили. Отказ.\r\n", "2019-08-20T05:23:47.066273646Z", "серебристый, красный", "18.0", 3, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "43": ["Брала на подарок... Пришло без подарочной коробки,к сожалению!!! (*вместо него какой то непонятный затертый мешочек) В описании написано с подарочной упаковкой. Очень расстроилась(((   Сам браслет очень красивый. Мне понравился", "2019-08-09T07:24:38.706450813Z", "серебристый, красный", "18.0", 0, 2, 3, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "45": ["Отличный браслет , купила в подарок. ", "2019-08-04T02:48:21.947196427Z", "серебристый, красный", "18.0", 0, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "47": ["Ношу этот бросает не снимая около полугода), сегодня развязался узелок, не расстроилась, т.к. не потеряла) можно заново завязать и прижечь, можно завязать и узел зафиксировать дополнительно ниточками. По поводу размеров, если не регулировать,то да, на ребёнка, но ниточки сдвигаются и можно отрегулировать нужную длину. За время ежедневной эксплуатации металл ничуть не изменился, не потемнел и не погнулся! Крем для тела и для рук переносит отлично)))", "2019-08-06T21:37:58.675384545Z", "серебристый, красный", "19.0", 3, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "48": ["Заказываю уже не раз себе и в падарок.. браслет красивый. За хорошую скидку спасибо большое магазину..", "2019-07-19T13:38:03.255157121Z", "серебристый, красный", "17.0", 9, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "49": ["Браслетик не плохой,но очень тонкая нить,хорошо только на детскую руку", "2019-07-17T17:06:57.515973277Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "50": ["Отличный браслет! Очень симпатичные украшения, красивая добротная нить. Ношу с конца декабря, при том, что снимать нельзя, поэтому не снимая, пережил уже и поездку на море. На руке \"растягивается\" - приноровилась подтягивать, нить плотная шелковистая, по узлу скользит нормально. Качественная вещь, очень понравилась, спасибо!", "2019-06-12T22:02:48.381468465Z", "серебристый, красный", "17.0", 1, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "51": ["Люблю такие браслетики,мне понравился.", "2019-06-07T09:17:21.794178766Z", "серебристый, красный", "18.0", 3, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "52": ["Нормально так побаловаться, через несколько дней развязался узелок, а я не знаю, как его завязать(", "2019-05-27T06:26:11.153417093Z", "серебристый, красный", "18.0", 31, 0, 4, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "53": ["Может кому поможет. Мне помогло)) кончик потом обрезать и прижечь.", "2019-06-06T04:18:57.169321471Z", "серебристый, красный", "18.0", 4, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "54": ["Прикольная верёвочка, смотрится отлично, стильно, но в первый же день развязался один узелок. Теперь нужно что-то придумывать. Жаль...", "2019-05-30T08:13:56.732220352Z", "серебристый, красный", "19.0", 5, 0, 3, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "55": ["Браслет понравился...НО..развязался на третий день. Завязала снова..но радость была недолгой..снова развязался, чудом не потерялся, так как была дома. Второй раз завязать не получилось....лежит теперь браслетик  бесполезно...почитала отзывы - не у меня одной такая же проблема... и мне пришел просто в пакетике, без коробочки...", "2019-05-11T17:52:05.442209843Z", "серебристый, красный", "18.0", 2, 0, 3, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "56": ["Развязался в первый же день.не рекомендую", "2019-05-09T17:15:41.535853135Z", "серебристый, красный", "19.0", 1, 0, 3, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "57": ["Браслет классный, на тонком запястье очень хорошо смотрится. Беру подобные не первый раз, но первый раз после трех дней носки развязались оба узелка. Чудом не потеряла. Завязала обратно, но они снова развязываются и концы торчат. Как носить теперь, не понятно.", "2019-05-09T04:34:38.161505815Z", "серебристый, красный", "17.0", 2, 0, 4, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "58": ["Брала со скидкой 2 штуки (себе и маме) за 226 рублей. Ниточка понравилась. Но радость была не долгой. У меня развязался узелок и браслет потерялся. Нашла дома. Но завязать такой узел не смогу. У мамы случилось тоже самое. Но на неделю позже. Потеряла на улице. Короче. Выброшенные на ветер деньги. К покупке не рекомендую 👎", "2019-05-07T15:47:15.86741015Z", "серебристый, красный", "17.0", 1, 0, 3, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "59": ["Миленький , пришёл с коробочкой )", "2019-04-30T11:50:29.637421857Z", "серебристый, красный", "17.0", 4, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "61": ["Красивый браслетик, только вот самостоятельно затянуть на запястье не получится, нужна чья-то помощь.", "2019-04-27T19:53:33.070043755Z", "серебристый, красный", "18.0", 5, 2, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "62": ["Браслет прикольный.Мне все понравилось.Отмечу что нить сама на браслете снадписью 'счастье' грубее и менее скользкая,поэтому и узлы надежнее и аккуратнее.Сдесь нитка более шелковистая,скользящая.Поэтому и узелки могут быть хуже сделанны.Я свои сразу проверила и поправила для надежности.Теперь точно не развяжутся.Ношу не снимая уже месяц.Все ок.", "2019-04-27T13:29:32.966608979Z", "серебристый, красный", "18.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "63": ["Очень понравился браслет. Купила 16.04. Надела и не снимаю. Не растянулся, не потемнел, нитка крепкая. Сегодня забрала еще один для сестры. Рекомендую.", "2019-04-25T10:17:04.270491958Z", "серебристый, красный", "19.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "64": ["Браслет миниатюрный,узелок развязался в первый день.", "2019-04-19T18:36:49.694391857Z", "серебристый, красный", "17.0", 1, 0, 3, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "66": ["Проба есть только на колечке для фирменного логотипа, сам знак бесконечности выглядит как безделушка, красная цена 50р такой вещи", "2019-04-18T20:27:57.479616413Z", "серебристый, красный", "18.0", 2, 1, 2, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "68": ["Как всегда отлично", "2019-04-18T11:27:58.418042446Z", "серебристый, красный", "17.0", 3, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "69": ["Давно хотела себе браслетик с красной нитью, но во всех ювелирках такие браслетики стоят от 480 р и больше. И вот я наткнулась на этот браслетик и решила его заказать к своему Дню Рождения, тем более мне прислали промокод на дополнительную скидку и браслетик обошёлся по очень привлекательной цене. Заказала специально на размер больше. Браслетик мне понравился, к моей руке подошёл, но затянуть его на своём запястье немного проблематично, но если приноровиться, то это проблемой не будет. Пришёл с бирочкой и пломбой, в фирменной коробочке. Очень приятно, порадовали. Спасибо большое!)))", "2019-04-13T09:42:31.575660851Z", "серебристый, красный", "19.0", 1, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "70": ["Покупала дочери 10 лет носит уже больше полугода ничего не развязывается. Ей очень нравится. Рекомендую.", "2019-04-08T16:02:38.672309669Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "71": ["Миленький, аккуратный браслет. Длина регулируется. Пришёл в фирменной коробке, пломба на месте. На подарок отлично", "2019-03-17T09:11:06.769799451Z", "серебристый, красный", "17.0", 2, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "72": ["Фото решила не прикладывать - их итак достаточно :). Добавлю лишь (не знаю, есть ли такое у кого-то в комментах), что диаметр круглого элемента, кажется, немного меньше, но это его нисколько не умаляет - забирала моя дочь, была в восторге, пришлось ещё и детям (взрослым) заказать (были предназначены подругам). Тут пишут, что на тонкую руку нормально, так вот: на полной тоже смотрится очень симпатично. Подругам очень понравилось, так что не слушайте про \"трёхлетнего ребёнка\" и про \"пинчера\" - главное правильно узелки растянуть (потом, соответственно, их назад сжать ;) ). Правда, есть одно \"но\": второй раз, когда заказывала детям, браслетики пришли без коробочек, благо, что своим - поняли, простили ;). А так - большое спасибо, и фирме за задумку, и магазину!!! П.с. Интересно, где же наши три коробочки задевались? ;)", "2019-03-11T11:35:03.46896574Z", "серебристый, красный", "17.0", 4, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "73": ["Нет подарочной коробки,к сожалению!Брала на подарок...", "2019-03-08T15:12:34.533281154Z", "серебристый, красный", "17.0", 0, 1, 4, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "74": ["Увидев браслет была в недоумении, не понимала, как мне его одеть на руку, хотела отказаться. Пока сотрудник магазина расчитывала покупателя, решила все же примерить, удалось это не легко, но всё же он на моей руке, чему рада, он мне нравиться😊", "2019-03-08T12:16:18.385072273Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "76": ["На очень малюсенькую ручку((", "2019-03-07T12:09:10.563118637Z", "серебристый, красный", "17.0", 0, 2, 1, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "77": ["Симпатичный, душевный браслетик, нормального размера серебряные элементы, не хлипкие, хорошая ниточка.", "2019-02-25T14:02:03.429376916Z", "серебристый, красный", "17.0", 2, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "79": ["Действительно, как тут уже писали, на ребёнка 3х лет он самое то.. совсем не соответствует указанному размеру!", "2019-02-13T13:38:41.214676554Z", "серебристый, красный", "17.0", 1, 4, 1, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "81": ["Хотела купить племяшкам на 8 марта, но не понравился браслетик.. нить тонкая, узлы не аккуратные, подвеска тонюсенькая.. лучше взять  другого производителя чуть дороже, но более качественную", "2019-01-30T10:04:30.947697129Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "82": ["Милый брастетик, узелки вроде крепкие. Взяла потому что нужна была красная нить. Несколько раз брала то в ***, то в ***, не хватает и на неделю. Посмотрю как это себя поведет", "2019-01-17T11:37:26.263331246Z", "серебристый, красный", "17.0", 4, 2, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "83": ["Отличная красная ниточка на счастье. Подарю подруге на Рождество! Ниточка регулируется по размеру и держится крепко,при желании её можно снять,но надеть самой сложно.", "2019-01-08T16:44:39.801100552Z", "серебристый, красный", "17.0", 4, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "87": ["Миленько!!! Качество отличное!", "2018-12-09T16:25:15.851218117Z", "серебристый, красный", "17.0", 10, 3, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "88": ["Вообще не поняла,что это за браслет?! Окружностью см.5,на лапу моего пинчера?! Отказ.", "2018-11-19T08:49:05.092340033Z", "серебристый, красный", "17.0", 3, 12, 2, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "89": ["Красивый браслетик,но коробка измялась.", "2018-11-13T15:33:33.420232126Z", "серебристый, красный", "17.0", 2, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "90": ["Симпатичный браслетик, такой-же в ювелирке 600 руб.", "2018-11-05T17:16:57.638741074Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "94": ["Браслет пришел уже не качественный,пока мерили узлы все развязались ", "2018-08-15T07:13:30.418816135Z", "серебристый, красный", "17.0", 2, 1, 3, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "95": ["317р. Спасибо магазину за скидку. На браслете нет пломбы. А так очень миленький.", "2018-07-23T07:27:52.224665589Z", "серебристый, красный", "17.0", 10, 1, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "96": ["милая вещица!!!Покупкой довольна!!!", "2018-07-22T18:00:09.995408319Z", "серебристый, красный", "17.0", 1, 0, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "97": ["Браслет неплохой, но на самом браслете проба не стоит. На ярлыке написано:серебро 925, 0,90 гр. В целом мило, но за полную цену никогда бы не купила! Брала за 288₽.", "2018-07-08T20:19:22.057864049Z", "серебристый, красный", "17.0", 4, 0, 4, "Браслет \"Красная нить - Бесконечность\"", "Lucente"], "98": ["Браслет  очень миниатюрный , нить тонкая.но я такой и хотела, на тонкой руке смотреться гармонично ", "2018-07-02T08:13:08.285794259Z", "серебристый, красный", "17.0", 31, 4, 5, "Браслет \"Красная нить - Бесконечность\"", "Lucente"]}
